import React, { Component } from 'react';
import { connect } from 'react-redux';
import ProductList from "components/redux/ProductList";
//import { increment, decrement } from 'store/modules/productList';

class ProductListContainer extends Component { //3

    render() {
        const { id, title, subtitle } = this.props;

        console.log("id: " + id);
        return (
            <ProductList
                id={id}
                title={title}
                subtitle={subtitle}
            />
        );
    }
}
const mapStateToProps = ({ productList }) => ({  //2
    id: productList.id,
    title: productList.title,
    subtitle: productList.subtitle
});



export default connect( // 스토어와 연결
    mapStateToProps,

)(ProductListContainer);
